function dict_GetAll(table, all, val, data) {
    var json = eval("(" + data + ")");
    var DICT_id = new Array();
    var DICT_name = new Array();
    var idx = 0;
    $(json.Head).each(function () {
        DICT_id[idx] = this.id;
        DICT_name[idx] = this.name;
        idx++;
    });
    init_select(table, all, DICT_id, DICT_name);
    fill_select_nde(table, val);
}
function dict_GetValue(data, id) {
    if (id == null || id.length == 0) return "";
    var json = eval("(" + data + ")");
    var name = "";
    $(json.Head).each(function () {
        if (id == this.id) { name = this.name; return false; }
    });
    return name;
}
